import React from "react";

import Spinner from "../spinner/spinner.component";

const WithSpinner = WrappedConponent => {
  const Spinner = ({ isLoading, ...otherProps }) => {
    return isLoading ? (
      <Spinner />
    ) : (
      <WrappedConponent {...otherProps} />
    );
  };
  return Spinner;
};

export default WithSpinner;
